import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import '../styles/LoanApproval.css';

const LoanApproval = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const formData = location.state?.formData || {};

 const loanAmount = location.state?.loanAmount || 0;
const verificationFee = location.state?.verificationFee || 0;


  const handleGetLoan = () => {
    alert('Loan application submitted!');
  };

  const handleGoBack = () => {
    navigate('/');
  };

  return (
    <div className="approval-container">
      <div className="approval-card">
        <div className="approval-header">
          <p>
            Hi {formData.name }, you have qualified for a Loan of Ksh. {loanAmount.toLocaleString()} to your M-PESA. Your loan repayment period is 2 months with a 10% interest rate. Terms and conditions apply
          </p>
        </div>

        <div className="approval-body">
          <div className="approval-table">
            <div className="approval-row">
              <span className="approval-label">Loan Tracking ID:</span>
              <span className="approval-value">LON-C894154L1935128</span>
            </div>

            <div className="approval-row">
              <span className="approval-label">Your Names:</span>
              <span className="approval-value">{formData.name}</span>
            </div>

            <div className="approval-row">
              <span className="approval-label">MPESA Number:</span>
              <span className="approval-value">{formData.phone || '0789678589'}</span>
            </div>

            <div className="approval-row">
              <span className="approval-label">ID Number:</span>
              <span className="approval-value">{formData.idNumber || '34779987'}</span>
            </div>

            <div className="approval-row">
              <span className="approval-label">Loan Type</span>
              <span className="approval-value">{formData.loanType || 'Car Loan'}</span>
            </div>

            <div className="approval-row">
              <span className="approval-label">Qualified Loan</span>
              <span className="approval-value">Ksh. {loanAmount.toLocaleString()}</span>
            </div>

            <div className="approval-row">
              <span className="approval-label">Verification Fee</span>
              <span className="approval-value">Ksh. {verificationFee}</span>
            </div>
          </div>

          <div className="approval-footer">
            <p className="approval-terms">
              By submitting you confirm that you accept the{' '}
              <a href="#terms">Terms and Conditions</a> and{' '}
              <a href="#privacy">Privacy Policy</a>
            </p>

            <button onClick={handleGetLoan} className="get-loan-btn">
              Get Loan Now
            </button>

            <div className="approval-footer-text">
              Â© 2025. All rights reserved. Go back
              <a onClick={handleGoBack} style={{ cursor: 'pointer' }}>
                home
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoanApproval;
